import { Container, Row, Col, Placeholder } from 'react-bootstrap';

import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Offcanvas from 'react-bootstrap/Offcanvas';
import { render } from 'react-dom';


import halfbyte from "../works/halfbyte.png";
import upcancer from "../works/upcancer.png";
import likeex from "../works/likeex.jpg";

export default function Other() {
    return (
        <Container class="wrapper">
            <Row className='galleryP'>
                <h1 className='mb-3'>/work</h1>
                <div class="wrapper">
                    <div class="media">
                        <div class="layer">
                            <p>+ UI/UX Design</p>
                        </div>
                        <img src={likeex} alt="" />
                    </div>
                    <div class="media">
                        <div class="layer">
                            <p>+ UX Research</p>
                        </div>
                        <img src={upcancer} alt="" />
                    </div>
                    <div class="media">
                        <div class="layer">
                            <p>+ Game Development</p>
                        </div>
                        <img src={halfbyte} alt="" />
                    </div>
                </div>
            </Row>
            <>
                {['start', 'end', 'top', 'bottom'].map((placement, idx) => (
                    <OffCanvasExample key={idx} placement={placement} name={placement} />
                ))}
            </>

        </Container >
    )
}

function OffCanvasExample({ name, ...props }) {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    return (
        <>
            <Button variant="primary" onClick={handleShow} className="me-2">
                {name}
            </Button>
            <Offcanvas show={show} onHide={handleClose} {...props}>
                <Offcanvas.Header closeButton>
                    <Offcanvas.Title>Offcanvas</Offcanvas.Title>
                </Offcanvas.Header>
                <Offcanvas.Body>
                    Some text as placeholder. In real life you can have the elements you
                    have chosen. Like, text, images, lists, etc.
                </Offcanvas.Body>
            </Offcanvas>
        </>
    );
}

render(<Example />);
